:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  WILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Cyril Nelson Beetham and WILDER, Maud Margaret (Pearlie)
  JWILLIAMS, Timothy John Wilder and FOWLER, Patricia Faith
  JWILLIAMS, Mark Antony and HELMORE, Victoria Frances
  01> WILLIAMS, George Timothy
  b 15.06.1971
  George was educated at Hereworth School and Christ's College.
  02> WILLIAMS, Susan Faith m on 26.11.1976 to ANDERSON, Timothy Derek
  b 23.12.1947
  b 25.04.1947
  Susan b. at Hastings and m. at Elsthorpe. Timothy, slo Derek Arnott Anderson and Pamela Vernon Ashbolt.
  Address: Kalimera, Hundalee, Parnassus RD, North Canterbury.
  Susan was educated at Elsthorpe Primary School, Queenswood and Nga Tawa and is a Karitane nurse,
  teacher, school bus driver and member of the School Committee. In her earlier years she spent four
  years overseas, mainly in the UK and Europe, travelling home overland through Asia.
  Timothy is a farmer.
  01> ANDERSON, Tiffany Patricia
  b 17.08.1977
  Tiffany b. at Christchurch. She was educated at St Margaret's College, Christchurch then spent a
  year in Edinburgh as a GAP student. She studied interior design at Polytechnic.
  02> ANDERSON, Sophie Susan
  b 21.03.1979
  Sophie b. at Kaikoura. She was educated at St Margaret's College, Christchurch and is now at
  Lincoln University.
  03> ANDERSON, Victoria Pamela
  b 30.01.1983
  Victoria b, at Kaikoura. She is a student at St Margaret's College, Christchurch.
  04> ANDERSON, Edward Timothy Derek
  b 03.04.1987
  Edward b. at Christchurch. He has attended schools at Parnassus and Cheviot before going to
  Christ's College, Christchurch.
  03> WILLIAMS, Virginia Margaret (Gee) m on 31.07.1982 to SMITH, Patrick John
  b 25.08.1949
  b 01.10.1945
  Virginia b. at Hastings and m, at Auckland. Patrick, s/o Charles Gilbert Smith and Florence Annie Oram.
  Address: 15 Tongariro Street, Mount Eden, Auckland 3.
  Gee was educated at Elsthorpe Primary School, Queenswood School and Wellington Diocesan School for
  Girls, Nga Tawa where she was Head Prefect. She then studied for a degree in veterinary science at
  Massey University graduating in 1971. After a year in practice she spent two years in South America.
  Later she travelled again in America, Europe and Africa before settling in Auckland, Gee now pursues
  her veterinary career with an increasing interest in the area of veterinary acupuncture. Patrick is a
  writer and actor.
  01> SMITH, Benjamin Timothy
  b 03.03.1984
  Benjamin b. at Auckland.
  02> SMITH, Toby James
  b 31.03.1988
  Toby b, at Auckland.
